import React from "react";
import Box from "./Homepage";
import "./App.css";
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';

class Button extends React.Component {
    render() {
        return (
            <div id="nav-bar">
                <div className="navs" id="academics">
                    Faculty
                </div>
                <div className="navs" id="academics">
                    Academics
                </div>
                <div className="navs" id="academics">
                    Contact
                </div>
                <div className="navs default" id="academics">
                    Home
                </div>
            </div>
        )
    }
}

class Template extends React.Component {
    render() {
        return (
            <div id="container">
                <div id="header">
                    < Button />
                    <div id="logo"></div>
                </div>
                <Routes>
                <Route path="/" element={ < Template /> } ></Route>
                </Routes>
                <div id="footer">
                    <div class="footItem">
                        <p class="fhead">Address</p>
                        {/* <span id="location"></span> */}
                        Jasper Hostel, Block A, Room - 450, IIT(ISM) Dhanbad, Jharkhand, India    
                    </div>
                    <div class="footItem">
                        <p class="fhead">Mobile</p>
                        020-123456789, 9012345678   
                    </div>
                    <div class="footItem">
                        <p class="fhead">E-mail</p>
                        physicsphysics@iitism.ac.in  
                    </div>
                </div>
            </div>
        )
    }
}

export default Template;
